diff --git a/src/Interpreters/GlobalSubqueriesVisitor.h b/src/Interpreters/GlobalSubqueriesVisitor.h
index 71ff7fd2e0e3..6a87527dc9c0 100644
--- a/src/Interpreters/GlobalSubqueriesVisitor.h
